import React from 'react';
import { View, Card, CardGrid, Panel, PanelHeader, Group, Button } from '@vkontakte/vkui';



class Main extends React.Component {
    constructor(props) {
        super(props);
    }
    
    render() {
        return(
            <View>
              <h1>Проверка</h1> 
               <Button size="xl" mode="secondary">Просто кнопка</Button>
            </View>     
        );
    }
}

export default Main;
